export const Header = () => {
    return (
        <ChakraProvider>
            <Box minHeight='100vh' backgroundColor='black'>
            <Skeleton startColor='purple.900' endColor='black.900' height='50px' />
                <Box color='white' fontSize='50px' borderRadius='20px' width='50%' paddingLeft='150px'>
                    <h1>Dio Bank</h1>
                </Box>
            </Box>
        </ChakraProvider>

    )
}
